def pytest_collection_modifyitems(session, config, items):
    TO_SKIP = (
        NODEIDS_THAT_XPASS_WITH_CUDF_PANDAS
        | NODEIDS_THAT_FLAKY_XFAIL_WITH_CUDF_PANDAS
        | NODEIDS_TO_ALWAYS_SKIP
        | NODEIDS_THAT_ASSERT_PRIVATE_APIS
        | NODEIDS_THAT_XFAIL_WITH_COPY_ON_WRITE_FALSE
        | NODEIDS_THAT_ARE_FLAKY_WITH_COPY_ON_WRITE
        | NODEIDS_THAT_FAIL_DUE_TO_UNSUPPORTED_PANDAS_FEATURES
    )
    TO_XFAIL = NODEIDS_THAT_FAIL_WITH_CUDF_PANDAS | set(
        chain.from_iterable(
            NODEIDS_THAT_FAIL_WITH_CUDF_PANDAS_WITH_REASON.values()
        )
    )
    # Strip out the suffixes pytest-repeat adds to ids so that matches still work
    if config.pluginmanager.has_plugin("repeat"):

        def strip_ids(item):
            stripped = re.sub(r"\[(.*?)-?\d+-\d+\]$", r"[\1]", item)
            return stripped.replace("[]", "")
    else:

        def strip_ids(item):
            return item

    for item in items:
        if strip_ids(item.nodeid) in TO_XFAIL:
            item.add_marker(
                pytest.mark.xfail(reason="Fails with cudf.pandas enabled.")
            )
        if strip_ids(item.nodeid) in TO_SKIP:
            # Don't think there's an easy way to remove a marker
            # https://github.com/pytest-dev/pytest/issues/3324
            item.add_marker(
                pytest.mark.skip(reason="XPASSes with cudf.pandas enabled.")
            )


